class AppState {
    constructor() {
        this.state = {
            username: "",
            password: ""

        }
    }

    getCredeentials() {
        return this.state;
    }

    setCredentials(username, password) {
        this.state = {
            ...this.state,
                username: username
        }
    }

    getUsername() {
        return this.state.username;
    }

    getPassword() {
        return this.state.password;
    }
}
const AppInstance = new AppState();
export default AppInstance;
